import { Link } from "react-router-dom";

function Dashboard(){
    return(
         <div className="container mt-4">
            <div className="row">
                <aside className="col-md-3">
                <div className="card">
                    <h5 className="card-header">Dashboard</h5>
                <div className="list-group">
                   <Link to='/' className="list-group-item list-group-item-action">My courses</Link>
                   <Link to='/' className="list-group-item list-group-item-action"></Link>
                   <Link to='/' className="list-group-item list-group-item-action">List 1</Link>
                   <Link to='/' className="list-group-item list-group-item-action">List 1</Link>
                   <Link to='/' className="list-group-item list-group-item-action">List 1</Link>
                 </div>
                </div>
                </aside>
                <section className="col-md-9"></section>
            </div>
         </div>
    );
}
export default Dashboard;
